import intervalIcon from "../assets/icons/interval-icon.svg";
import freestyleIcon from "../assets/icons/freestyle-icon.svg";

export const modesList = [
  {
    name: "Interval",
    photo: intervalIcon,
  },
  {
    name: "Freestyle",
    photo: freestyleIcon,
  },
];
